import { 
    IonButton,
    IonContent,
    IonInput,
    IonItem,
    IonLabel,
    IonTextarea,
} from '@ionic/react';
import React, { useState } from 'react';
import { Header } from '../../components/header';

export const AddProduct: React.FC = () => {
    const [product, setProduct] = useState({
        title: undefined,
        price: undefined,
        image: null,
        description: undefined
    })

    const setValue = (event: any) => {
        console.log('adsadsadas', 'event stat');
        console.log(event.target, 'event');
        debugger;
        // setProduct({
        //     ...product,
        //     [event.target.name]: event.target.value
        // });
    }

    return (
        <>
            <Header
                title={'Add product'}
                key={'AddProduct'}
            />
            <IonContent>
                <form onSubmit={setValue}>
                    <IonItem>
                        <IonLabel>Title:</IonLabel>
                        <IonInput name="title" type="text" />
                    </IonItem>
                    <IonItem>
                        <IonLabel>Price:</IonLabel>
                        <IonInput name="price" type="number" />
                    </IonItem>
                    <IonItem>
                        <IonLabel>Image:</IonLabel>
                        <IonInput name="image" type="text" />
                    </IonItem>
                    <IonItem>
                        <IonLabel>Description:</IonLabel>
                        <IonTextarea name="title" />
                    </IonItem>
                    <IonButton expand="block" type="submit" color="warning">Accept</IonButton>
                </form>
            </IonContent>
        </>
    );
}
